Patch Set 9:

The following loop can be further optimized because 2nd, 3rd or 4th byte in a UTF8 character starts with 0x10. 

int find_one_CHAR_backwards(int pos) {
  int last_pos = pos;
  for (int i=0; i<4; i++) {
    if (BitUtil::IsUtf8StartByte(ptr[pos])) return pos;
    pos--;
    if (pos<0) break;
  }
  // non UTF8 character
  return last_pos;
}
